      return (
        <div className="Home">
          <div className="container">
            <div className="row">
              <div className="Home__col col-12 col-md-6">
                <img src={M} className="img-fluid mb-2"/>
                
              </div>
              <h1>¡¡¡Hi!!!</h1>
                <Link className="btn btn-primary" to="/badges">
                  Ver
                </Link>
            </div>
          </div>
        </div>
      );
    }
  }
